import { Route, Router, Routes } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Volantini Express</h1>
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
